snippet.textDisplay:
This man has SO MUCH talent and pathos in his voice that he can make us all weep even if he sings a happy song. The signature low key instrument arrangement is typical Jaffer Zaidi.. Now back to this, I wish strings produced this better. The sound is still cluttered and lacks the effortless crispness of Rohail Hyatt and his times. Ali sethi validates all hopeless romantics like me. It is so good to hear this man singing. Not that I don't want him to sing original stuff but I feel Ali sethi should sing all the classics of all generations. all of them. A legend in the making, a killer to the core, music and his velvet voice with 'alaaps' to die for,  being his weapons of choice. Ali Sethi, I love you. You hear me? I LOVE YOU!

Love and chummmma from India
@Rohwit

